idades de env\\u00edo.\\nCompare cotizaciones de env\\u00edo, genere etiquetas, programe recolecciones y controle las finanzas a trav\\u00e9s de nuestro intuitivo software de env\\u00edo basado en la nube. Explore nuestro software de env\\u00edo.\",\"zh\":\"\\u4e00\\u79cd\\u7ba1\\u7406\\u548c\\u81ea\\u52a8\\u5316\\u6240\\u6709\\u8fd0\\u8f93\\u9700\\u6c42\\u7684\\u5de5\\u5177\\u3002\\n\\u901a\\u8fc7\\u6211\\u4eec\\u76f4\\u89c2\\u7684\\u57fa\\u4e8e\\u4e91\\u7684\\u8fd0\\u8f93\\u8f6f\\u4ef6\\u6bd4\\u8f83\\u8fd0\\u8f93\\u62a5\\u4ef7\\u3001\\u751f\\u6210\\u6807\\u7b7e\\u3001\\u5b89\\u6392\\u53d6\\u4ef6\\u548c\\u76d1\\u63a7\\u8d22\\u52a1\\u3002 \\u63a2\\u7d22\\u6211\\u4eec\\u7684\\u8fd0\\u8f93\\u8f6f\\u4ef6\\u3002\"}}', 'info', 'homepage', NULL, 15, 'easyship', 5, '2022-04-28 16:30:31', '2022-06-13 13:31:38'),
(10, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"start\",\"section_title\":{\"en\":\"Access Our Network of Global Warehouses\",\"ger\":\"Greifen Sie auf unser Netzwerk globaler Lagerh\\u00e4user zu\",\"fr\":\"Acc\\u00e9dez \\u00e0 notre r\\u00e9seau d\'entrep\\u00f4ts mondiaux\",\"tr\":\"K\\u00fcresel Depo A\\u011f\\u0131m\\u0131za Eri\\u015fin\",\"pt\":\"Acesse nossa rede de armaz\\u00e9ns globais\",\"ar\":\"\\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 \\u0625\\u0644\\u0649 \\u0634\\u0628\\u0643\\u062a\\u0646\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0633\\u062a\\u0648\\u062f\\u0639\\u0627\\u062a \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\\u0629\",\"bn\":\"\\u0997\\u09cd\\u09b2\\u09cb\\u09ac\\u09be\\u09b2 \\u0993\\u09af\\u09bc\\u09be\\u09b0\\u09b9\\u09be\\u0989\\u09b8\\u09c7\\u09b0 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09a8\\u09c7\\u099f\\u0993\\u09af\\u09bc\\u09be\\u09b0\\u09cd\\u0995 \\u0985\\u09cd\\u09af\\u09be\\u0995\\u09cd\\u09b8\\u09c7\\u09b8 \\u0995\\u09b0\\u09c1\\u09a8\",\"ru\":\"\\u041f\\u043e\\u043b\\u0443\\u0447\\u0438\\u0442\\u0435 \\u0434\\u043e\\u0441\\u0442\\u0443\\u043f \\u043a \\u043d\\u0430\\u0448\\u0435\\u0439 \\u0441\\u0435\\u0442\\u0438 \\u0433\\u043b\\u043e\\u0431\\u0430\\u043b\\u044c\\u043d\\u044b\\u0445 \\u0441\\u043a\\u043b\\u0430\\u0434\\u043e\\u0432\",\"es\":\"Accede a Nuestra Red de Almacenes Globales\",\"zh\":\"\\u8bbf\\u95ee\\u6211\\u4eec\\u7684\\u5168\\u7403\\u4ed3\\u5e93\\u7f51\\u7edc\"},\"section_description\":{\"en\":\"Improving transit times, lowering shipping costs, and reducing tariff exposure has never been easier than with our global network of 3PL partners. Our shipping consultants will tailor a fulfillment strategy perfect for your business. Learn more about our fulfillment network.\",\"ger\":\"Noch nie war es einfacher als mit unserem globalen Netzwerk von 3PL-Partnern, Laufzeiten zu verk\\u00fcrzen, Versandkosten zu senken und Zollgeb\\u00fchren zu reduzieren. Unsere Versandberater werden eine f\\u00fcr Ihr Unternehmen perfekte Fulfillment-Strategie ma\\u00dfschneidern. Erfahren Sie mehr \\u00fcber unser Fulfillment-Netzwerk.\",\"fr\":\"Am\\u00e9liorer les temps de transit, r\\u00e9duire les co\\u00fbts d\'exp\\u00e9dition et r\\u00e9duire l\'exposition aux tarifs n\'a jamais \\u00e9t\\u00e9 aussi facile qu\'avec notre r\\u00e9seau mondial de partenaires 3PL. Nos consultants en exp\\u00e9dition adapteront une strat\\u00e9gie d\'ex\\u00e9cution parfaite pour votre entreprise. En savoir plus sur notre r\\u00e9seau de distribution.\",\"tr\":\"Ta\\u015f\\u0131ma s\\u00fcrelerini iyile\\u015ftirmek, nakliye maliyetlerini d\\u00fc\\u015f\\u00fcrmek ve tarife maruziyetini azaltmak, k\\u00fcresel 3PL ortak a\\u011f\\u0131m\\u0131zla hi\\u00e7 olmad\\u0131\\u011f\\u0131 kadar kolay olmam\\u0131\\u015ft\\u0131. Nakliye dan\\u0131\\u015fmanlar\\u0131m\\u0131z, i\\u015fletmeniz i\\u00e7in m\\u00fckemmel bir sipari\\u015f kar\\u015f\\u0131lama stratejisi olu\\u015fturacakt\\u0131r. \\u0130kmal a\\u011f\\u0131m\\u0131z hakk\\u0131nda daha fazla bilgi edinin.\",\"pt\":\"Melhorar os tempos de tr\\u00e2nsito, reduzir os custos de envio e reduzir a exposi\\u00e7\\u00e3o tarif\\u00e1ria nunca foi t\\u00e3o f\\u00e1cil quanto com nossa rede global de parceiros 3PL. Nossos consultores de envio ir\\u00e3o adaptar uma estrat\\u00e9gia de atendimento perfeita para o seu neg\\u00f3cio. Saiba mais sobre nossa rede de atendimento.\",\"ar\":\"\\u0644\\u0645 \\u064a\\u0643\\u0646 \\u062a\\u062d\\u0633\\u064a\\u0646 \\u0623\\u0648\\u0642\\u0627\\u062a \\u0627\\u0644\\u062a\\u0631\\u0627\\u0646\\u0632\\u064a\\u062a \\u060c \\u0648\\u062e\\u0641\\u0636 \\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u060c \\u0648\\u062a\\u0642\\u0644\\u064a\\u0644 \\u0627\\u0644\\u062a\\u0639\\u0631\\u0636 \\u0644\\u0644\\u062a\\u0639\\u0631\\u064a\\u0641\\u0629 \\u0627\\u0644\\u062c\\u0645\\u0631\\u0643\\u064a\\u0629 \\u0623\\u0633\\u0647\\u0644 \\u0645\\u0646 \\u0623\\u064a \\u0648\\u0642\\u062a \\u0645\\u0636\\u0649 \\u0645\\u0639 \\u0634\\u0628\\u0643\\u062a\\u0646\\u0627 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\\u0629 \\u0645\\u0646 \\u0634\\u0631\\u0643\\u0627\\u0621 3PL. \\u0633\\u064a\\u0635\\u0645\\u0645 \\u0645\\u0633\\u062a\\u0634\\u0627\\u0631\\u0648 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0644\\u062f\\u064a\\u0646\\u0627 \\u0627\\u0633\\u062a\\u0631\\u0627\\u062a\\u064a\\u062c\\u064a\\u0629 \\u062a\\u0644\\u0628\\u064a\\u0629 \\u0645\\u062b\\u0627\\u0644\\u064a\\u0629 \\u0644\\u0639\\u0645\\u0644\\u0643. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0632\\u064a\\u062f \\u062d\\u0648\\u0644 \\u0634\\u0628\\u0643\\u0629 \\u0627\\u0644\\u0625\\u0646\\u062c\\u0627\\u0632 \\u0644\\u062f\\u064a\\u0646\\u0627.\",\"bn\":\"\\u099f\\u09cd\\u09b0\\u09be\\u09a8\\u099c\\u09bf\\u099f \\u09b8\\u09ae\\u09af\\u09bc \\u0989\\u09a8\\u09cd\\u09a8\\u09a4 \\u0995\\u09b0\\u09be, \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u0996\\u09b0\\u099a \\u0995\\u09ae\\u09be\\u09a8\\u09cb \\u098f\\u09ac\\u0982 \\u099f\\u09cd\\u09af\\u09be\\u09b0\\u09bf\\u09ab \\u098f\\u0995\\u09cd\\u09b8\\u09aa\\u09cb\\u099c\\u09be\\u09b0 \\u0995\\u09ae\\u09be\\u09a8\\u09cb \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 3PL \\u0985\\u0982\\u09b6\\u09c0\\u09a6\\u09be\\u09b0\\u09a6\\u09c7\\u09b0 \\u09ac\\u09bf\\u09b6\\u09cd\\u09ac\\u09ac\\u09cd\\u09af\\u09be\\u09aa\\u09c0 \\u09a8\\u09c7\\u099f\\u0993\\u09af\\u09bc\\u09be\\u09b0\\u09cd\\u0995\\u09c7\\u09b0 \\u099a\\u09c7\\u09af\\u09bc\\u09c7 \\u09b8\\u09b9\\u099c \\u099b\\u09bf\\u09b2 \\u09a8\\u09be\\u0964 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09aa\\u09b0\\u09be\\u09ae\\u09b0\\u09cd\\u09b6\\u09a6\\u09be\\u09a4\\u09be\\u09b0\\u09be \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09ac\\u09cd\\u09af\\u09ac\\u09b8\\u09be\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u09a8\\u09bf\\u0996\\u09c1\\u0981\\u09a4 \\u098f\\u0995\\u099f\\u