9a4\\u09c7 \\u099a\\u09c7\\u09af\\u09bc\\u09c7\\u099b\\u09c7\\u09a8 \\u09a4\\u09be\\u09b0 \\u09b8\\u09ac\\u0995\\u09bf\\u099b\\u09c1\\u0987 \\u09b0\\u09af\\u09bc\\u09c7\\u099b\\u09c7\\u0964\",\"ru\":\"\\u0412 \\u043d\\u0430\\u0448\\u0435\\u0439 \\u0431\\u0438\\u0431\\u043b\\u0438\\u043e\\u0442\\u0435\\u043a\\u0435 \\u0440\\u0435\\u0441\\u0443\\u0440\\u0441\\u043e\\u0432 \\u0435\\u0441\\u0442\\u044c \\u0432\\u0441\\u0435, \\u0447\\u0442\\u043e \\u0432\\u044b \\u043a\\u043e\\u0433\\u0434\\u0430-\\u043b\\u0438\\u0431\\u043e \\u0445\\u043e\\u0442\\u0435\\u043b\\u0438 \\u0437\\u043d\\u0430\\u0442\\u044c \\u043e \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0435.\",\"es\":\"Nuestra biblioteca de recursos tiene todo lo que siempre quiso saber sobre env\\u00edos.\",\"zh\":\"\\u6211\\u4eec\\u7684\\u8d44\\u6e90\\u5e93\\u5305\\u542b\\u60a8\\u60f3\\u77e5\\u9053\\u7684\\u6709\\u5173\\u8fd0\\u8f93\\u7684\\u6240\\u6709\\u4fe1\\u606f\\u3002\"}}', 'goodhands', 'homepage', NULL, 16, 'easyship', 2, '2022-04-28 19:07:26', '2022-06-13 14:02:40'),
(14, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"button_bg_color\":null,\"button_text_color\":null,\"section_title\":{\"en\":\"Start Shipping in Minutes\",\"ger\":\"Starten Sie den Versand in wenigen Minuten\",\"fr\":\"Commencez \\u00e0 exp\\u00e9dier en quelques minutes\",\"tr\":\"Dakikalar \\u0130\\u00e7inde G\\u00f6nderimi Ba\\u015flat\\u0131n\",\"pt\":\"Comece a enviar em minutos\",\"ar\":\"\\u0627\\u0628\\u062f\\u0623 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0641\\u064a \\u062f\\u0642\\u0627\\u0626\\u0642\",\"bn\":\"\\u0995\\u09af\\u09bc\\u09c7\\u0995 \\u09ae\\u09bf\\u09a8\\u09bf\\u099f\\u09c7\\u09b0 \\u09ae\\u09a7\\u09cd\\u09af\\u09c7 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b6\\u09c1\\u09b0\\u09c1 \\u0995\\u09b0\\u09c1\\u09a8\",\"ru\":\"\\u041d\\u0430\\u0447\\u0430\\u0442\\u044c \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443 \\u0437\\u0430 \\u0441\\u0447\\u0438\\u0442\\u0430\\u043d\\u043d\\u044b\\u0435 \\u043c\\u0438\\u043d\\u0443\\u0442\\u044b\",\"es\":\"Comience a enviar en minutos\",\"zh\":\"\\u51e0\\u5206\\u949f\\u5185\\u5f00\\u59cb\\u53d1\\u8d27\"},\"section_subtitle\":{\"en\":\"You can try us for free. Everyone loves free.\",\"ger\":\"Sie k\\u00f6nnen uns kostenlos testen. Jeder liebt kostenlos.\",\"fr\":\"Vous pouvez nous essayer gratuitement. Tout le monde aime la gratuit\\u00e9.\",\"tr\":\"Bizi \\u00fccretsiz deneyebilirsiniz. Herkes \\u00f6zg\\u00fcr sever.\",\"pt\":\"Voc\\u00ea pode nos experimentar gratuitamente. Todo mundo adora gr\\u00e1tis.\",\"ar\":\"\\u064a\\u0645\\u0643\\u0646\\u0643 \\u062a\\u062c\\u0631\\u0628\\u062a\\u0646\\u0627 \\u0645\\u062c\\u0627\\u0646\\u0627. \\u0627\\u0644\\u062c\\u0645\\u064a\\u0639 \\u064a\\u062d\\u0628 \\u0645\\u062c\\u0627\\u0646\\u0627.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09bf \\u09ac\\u09bf\\u09a8\\u09be\\u09ae\\u09c2\\u09b2\\u09cd\\u09af\\u09c7 \\u099c\\u09a8\\u09cd\\u09af \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u099a\\u09c7\\u09b7\\u09cd\\u099f\\u09be \\u0995\\u09b0\\u09a4\\u09c7 \\u09aa\\u09be\\u09b0\\u09c7\\u09a8. \\u09b8\\u09ac\\u09be\\u0987 \\u09ac\\u09bf\\u09a8\\u09be\\u09ae\\u09c2\\u09b2\\u09cd\\u09af\\u09c7 \\u09ad\\u09be\\u09b2\\u09cb\\u09ac\\u09be\\u09b8\\u09c7\\u0964\",\"ru\":\"\\u0412\\u044b \\u043c\\u043e\\u0436\\u0435\\u0442\\u0435 \\u043f\\u043e\\u043f\\u0440\\u043e\\u0431\\u043e\\u0432\\u0430\\u0442\\u044c \\u043d\\u0430\\u0441 \\u0431\\u0435\\u0441\\u043f\\u043b\\u0430\\u0442\\u043d\\u043e. \\u0412\\u0441\\u0435 \\u043b\\u044e\\u0431\\u044f\\u0442 \\u0431\\u0435\\u0441\\u043f\\u043b\\u0430\\u0442\\u043d\\u043e.\",\"es\":\"Puedes probarnos gratis. Todo el mundo ama gratis.\",\"zh\":\"\\u60a8\\u53ef\\u4ee5\\u514d\\u8d39\\u8bd5\\u7528\\u6211\\u4eec\\u3002 \\u6bcf\\u4e2a\\u4eba\\u90fd\\u559c\\u6b22\\u81ea\\u7531\\u3002\"},\"section_description\":{\"en\":\"Already at scale? Our shipping and logistics experts can build the perfect global logistics setup for your needs.\",\"ger\":\"Bereits im Ma\\u00dfstab? Unsere Versand- und Logistikexperten k\\u00f6nnen das perfekte globale Logistik-Setup f\\u00fcr Ihre Anforderungen erstellen.\",\"fr\":\"D\\u00e9j\\u00e0 \\u00e0 grande \\u00e9chelle\\u00a0? Nos experts en exp\\u00e9dition et en logistique peuvent cr\\u00e9er la configuration logistique mondiale parfaite pour vos besoins.\",\"tr\":\"Zaten \\u00f6l\\u00e7ekte mi? Nakliye ve lojistik uzmanlar\\u0131m\\u0131z, ihtiya\\u00e7lar\\u0131n\\u0131z i\\u00e7in m\\u00fckemmel k\\u00fcresel lojistik kurulumunu olu\\u015fturabilir.\",\"pt\":\"J\\u00e1 est\\u00e1 em escala? Nossos especialistas em transporte e log\\u00edstica podem criar a configura\\u00e7\\u00e3o de log\\u00edstica global perfeita para suas necessidades.\",\"ar\":\"\\u0628\\u0627\\u0644\\u0641\\u0639\\u0644 \\u0639\\u0644\\u0649 \\u0646\\u0637\\u0627\\u0642 \\u0648\\u0627\\u0633\\u0639\\u061f \\u064a\\u0645\\u0643\\u0646 \\u0644\\u062e\\u0628\\u0631\\u0627\\u0621 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0648\\u0627\\u0644\\u062e\\u062f\\u0645\\u0627\\u