(1, 1, '{\"en\":\"Cargo Software \\u2013 Domestic and International Problem Solver\",\"ar\":\"\\u0628\\u0631\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646 - \\u062d\\u0644 \\u0627\\u0644\\u0645\\u0634\\u0643\\u0644\\u0627\\u062a \\u0627\\u0644\\u0645\\u062d\\u0644\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062f\\u0648\\u0644\\u064a\\u0629\",\"ger\":\"Cargo Software \\u2013 nationaler und internationaler Probleml\\u00f6ser\",\"fr\":\"Logiciel de fret - Solutionneur de probl\\u00e8mes nationaux et internationaux\",\"tr\":\"Kargo Yaz\\u0131l\\u0131mlar\\u0131 \\u2013 Yurti\\u00e7i ve Yurtd\\u0131\\u015f\\u0131 Problem \\u00c7\\u00f6z\\u00fcc\\u00fc\",\"pt\":\"Software de Carga - Solucionador de Problemas Dom\\u00e9sticos e Internacionais\",\"bn\":\"\\u0995\\u09be\\u09b0\\u09cd\\u0997\\u09cb \\u09b8\\u09ab\\u09cd\\u099f\\u0993\\u09af\\u09bc\\u09cd\\u09af\\u09be\\u09b0 - \\u09a6\\u09c7\\u09b6\\u09c0\\u09af\\u09bc \\u098f\\u09ac\\u0982 \\u0986\\u09a8\\u09cd\\u09a4\\u09b0\\u09cd\\u099c\\u09be\\u09a4\\u09bf\\u0995 \\u09b8\\u09ae\\u09b8\\u09cd\\u09af\\u09be \\u09b8\\u09ae\\u09be\\u09a7\\u09be\\u09a8\\u0995\\u09be\\u09b0\\u09c0\",\"ru\":\"Cargo Software - \\u0440\\u0435\\u0448\\u0435\\u043d\\u0438\\u0435 \\u0432\\u043d\\u0443\\u0442\\u0440\\u0435\\u043d\\u043d\\u0438\\u0445 \\u0438 \\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u044b\\u0445 \\u043f\\u0440\\u043e\\u0431\\u043b\\u0435\\u043c\",\"es\":\"Cargo Software \\u2013 Solucionador de Problemas Nacionales e Internacionales\",\"zh\":\"\\u8d27\\u8fd0\\u8f6f\\u4ef6 - \\u56fd\\u5185\\u548c\\u56fd\\u9645\\u95ee\\u9898\\u89e3\\u51b3\\u8005\"}', 'cargo-software-domestic-and-international-problem-solver', '{\"en\":\"<p>Making use of cargo software specifically designed and developed for cargo companies all over the world is very much indispensable. If you are running a cargo company, no matter how small or big, then you might be aware of inherent problems in cargo related tasks. A small unnoticed flaw can create a number of problems so relying on a cargo software solution can effectively solve your problems.<\\/p><h2>Cargo Software Features<\\/h2><p><strong>Automating Required Tasks&nbsp;<\\/strong><\\/p><p>In order to operate effectively, it would be necessary to automate all required tasks. If you can automate everything, then you can have the ability to focus on other tasks with confidence.<\\/p><p><strong>Tracking Made Simpler<\\/strong><\\/p><p>One of the most important things that which can\\u2019t be overlooked is this: you will have to allow your customers to track their products and if you do, then the&nbsp;more&nbsp;customers you will attract. Let your customers track their orders \\/ their packages right through your website with the help of the reliable BoxOn cargo software.<\\/p><p><strong>Updating Data<\\/strong><\\/p><p>Update the data anytime you would like to provide your customers a chance to be up-to-date with everything with no hassle at all.<\\/p><p><strong>Automated or Manual Backup Options<\\/strong><\\/p><p>Users can have the option to automate the backup process or they can opt for manual backup process too. They can take the backup option anytime they\\u2019d like.<\\/p><p><strong>Rating System<\\/strong><\\/p><p>You can direct your energy on&nbsp;business core services by integrating a perfect rating system (based on tariff or based on custom rates) and modify the system at any time.<\\/p><p><strong>Saves Time and Money<\\/strong><\\/p><p>Making use of the cargo software, you can save a lot of your time and your staff\\u2019s time. You can save a lot of money too since you won\\u2019t&nbsp;need to employ professionals for record maintenance.<\\/p><p><strong>Security Logs<\\/strong><\\/p><p>The cargo software comes with the highest level of security. Administrators will have the option to assign access to anyone they want to. The access provided can fully be controlled and can be monitored through monitoring tools.<\\/p><p><strong>Customized Solution<\\/strong><\\/p><p>Users can have the option for a customized solution. They can gain success in all their cargo related tasks by making use of tailor-made solutions that can reflect their business requirements.<\\/p>\",\"ar\":\"<p>\\u064a\\u0639\\u062f \\u0627\\u0633\\u062a\\u062e\\u062f\\u0627\\u0645 \\u0628\\u0631\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0645\\u0635\\u0645\\u0645\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0637\\u0648\\u0631\\u0629 \\u062e\\u0635\\u064a\\u0635\\u064b\\u0627 \\u0644\\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u062d\\u0627\\u0621 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645 \\u0623\\u0645\\u0631\\u064b\\u0627 \\u0644\\u0627 \\u063a\\u0646\\u0649 \\u0639\\u0646\\u0647 \\u0625\\u0644\\u0649 \\u062d\\u062f \\u0643\\u0628\\u064a\\u0631. \\u0625\\u0630\\u0627 \\u0643\\u0646\\u062a \\u062a\\u062f\\u064a\\u0631 \\u0634\\u0631\\u0643\\u0629 \\u0634\\u062d\\u0646 \\u060c \\u0645\\u0647\\u0645\\u0627 \\u0643\\u0627\\u0646\\u062a \\u0635\\u063a\\u064a\\u0631\\u0629 \\u0623\\u0648 \\u0643\\u0628\\u064a\\u0631\\u0629 \\u060c \\u0641\\u0642\\u062f \\u062a\\u0643\\u0648\\u0646 \\u0639\\u0644\\u0649 \\u062f\\u0631\\u0627\\u064a\\u0629 \\u0628\\u0627\\u0644\\u0645\\u0634\\u0627\\u0643\\u0644 \\u0627\\u0644\\u0643\\u0627\\u0645\\u0646\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0647\\u0627\\u0645 \\u0627\\u0644\\u0645\\u062a\\u0639\\u0644\\u0642\\u0629 \\u0628\\u0627\\u0644\\u0634\\u062d\\u0646. \\u064a\\u0645\\u0643\\u0646 \\u0623\\u0646 \\u064a\\u0624\\u062f\\u064a \\u0639\\u064a\\u0628 \\u0635\\u063a\\u064a\\u0631 \\u0644\\u0645 \\u064a\\u0644\\u0627\\u062d\\u0638\\u0647 \\u0623\\u062d\\u062f \\u0625\\u0644\\u0649 \\u062d\\u062f\\u0648\\u062b \\u0639\\u062f\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0634\\u0627\\u0643\\u0644 \\u060c \\u0644\\u0630\\u0627 \\u0641\\u0625\\u0646 \\u0627\\u0644\\u0627\\u0639\\u062a\\u0645\\u0627\\u062f \\u0639\\u0644\\u0649 \\u062d\\u0644 \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646 \\u064a\\u0645\\u0643\\u0646 \\u0623\\u0646 \\u064a\\u062d\\u0644 \\u0645\\u0634\\u0627\\u0643\\u0644\\u0643 \\u0628\\u0634\\u0643\\u0644 \\u0641\\u0639\\u0627\\u0644.<\\/p><p><br><\\/p><p>\\u0645\\u064a\\u0632\\u0627\\u062a \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0627\\u0644\\u0634\\u062d\\u0646<\\/p><p>\\u0623\\u062a\\u0645\\u062a\\u0629 \\u0627\\u0644\\u0645\\u0647\\u0627\\u0645 \\u0627\\u0644\\u0645\\u0637\\u0644\\u0648\\u0628\\u0629<\\/p><p><br><\\/p><p>\\u0645\\u0646 \\u0623\\u062c\\u0644 \\u0627\\u0644\\u0639\\u0645\\u0644 \\u0628\\u0641\\u0639\\u0627\\u0644\\u064a\\u0629 \\u060c \\u0633\\u064a\\u0643\\u0648\\u0646 \\u0645\\u0646 \\u0627\\u0644\\u0636\\u0631\\u0648\\u0631\\u064a \\u0623\\u062a\\u0645\\u062a\\u0629 \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0645\\u0647\\u0627\\u0645 \\u0627\\u0644\\u0645\\u0637\\u0644\\u0648\\u0628\\u0629. \\u0625\\u0630\\u0627 \\u0643\\u0627\\u0646 \\u0628\\u0625\\u0645\\u0643\\u0627\\u0646\\u0643 \\u0623\\u062a\\u0645\\u062a\\u0629 \\u0643\\u0644 \\u0634\\u064a\\u0621 \\u060c \\u0641\\u064a\\u0645\\u0643\\u0646\\u0643 \\u062d\\u064a\\u0646\\u0626\\u0630\\u064d \\u0627\\u0644\\u062a\\u0631\\u0643\\u064a\\u0632 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0647\\u0627\\u0645 \\u0627\\u0644\\u0623\\u062e\\u0631\\u0649 \\u0628\\u062b\\u0642\\u0629.<\\/p><p><br><\\/p><p>\\u0623\\u0635\\u0628\\u062d \\u0627\\u0644\\u062a\\u062a\\u0628\\u0639 \\u0623\\u0628\\u0633\\u0637<\\/p><p><br><\\/p><p>\\u0623\\u062d\\u062f \\u0623\\u0647\\u0645 \\u0627\\u0644\\u0623\\u0634\\u064a\\u0627\\u0621 \\u0627\\u0644\\u062a\\u064a \\u0644\\u0627 \\u064a\\u0645\\u0643\\u0646 \\u0625\\u063a\\u0641\\u0627\\u0644\\u0647\\u0627 \\u0647\\u0648 \\u0647\\u0630\\u0627: \\u0633\\u064a\\u062a\\u0639\\u064a\\u0646 \\u0639\\u0644\\u064a\\u0643 \\u0627\\u0644\\u0633\\u0645\\u0627\\u062d \\u0644\\u0639\\u0645\\u0644\\